import React from 'react';
import './EmployeeCard.scss';

export default function EmployeeCard({ image, name, position, secondary }) {
  return (
    <div className="employee-card">
      <img
        className={
          secondary
            ? 'employee-card-image employee-card-image-secondary'
            : 'employee-card-image'
        }
        src={image}
        alt={name}
      />
      <h4>{name}</h4>
      <h5>{position}</h5>
    </div>
  );
}
